import React from "react";

import {
    Route,
    Switch,
    BrowserRouter
} from "react-router-dom";

/* Import Google Analytics wrapper-component */
import GAWrapper from "../components/tools/google/analytics/Wrapper";

import NavBarRegistration from "../components/navbar/NavBarRegistration";
import NavBarEndEvent from "../components/navbar/NavBarEndEvent";
import NavBarDuringEvent from "../components/navbar/NavBarDuringEvent";
import NavBarBunchMarketing from "../components/navbar/bunch/NavBarBunchMarketing";
import NavBarBunchCommunication from "../components/navbar/bunch/NavBarBunchCommunication";
import NavBarBunchBusinessFinance from "../components/navbar/bunch/NavBarBunchBusinessFinance";
import NavBarHourWithCompany from "../components/navbar/NavBarHourWithCompany";

import NavBarActivities from "../components/navbar/NavBarActivities";

import LandingBCF from "../components/landings/bcf/LandingBCF";
import BlockGifts from "../components/activities/gifts/BlockGifts";
import BlockTests from "../components/activities/tests/BlockTests";

import BlockMiniTests from "../components/activities/mini-tests/BlockMiniTests";

import BlockHourWithCompany from "../components/activities/hour-with-company/BlockHourWithCompany";

import BlockBunchMarketing from "../components/activities/bunches/marketing/BlockBunchMarketing";
import BlockBunchCommunication from "../components/activities/bunches/communication/BlockBunchCommunication";
import BlockBunchBusinessFinance from "../components/activities/bunches/business-finance/BlockBunchBusinessFinance";

import Footer from "../components/footer/Footer";

const Main = () => (
    <div>
        <BrowserRouter>
            {GAWrapper.init() && <GAWrapper.RouteTracker />}
            <Switch>
                <Route path="/bunch-marketing" component={BunchMarketingContainer} />
                <Route path="/bunch-communication" component={BunchCommunicationContainer}/>
                <Route path="/bunch-business-finance" component={BunchBusinessFinanceContainer}/>
                <Route
                    path="/gifts"
                    component={ActivitiesContainer} />
                <Route
                    path="/tests"
                    component={ActivitiesContainer} />
                <Route
                    path="/mini-tests"
                    component={ActivitiesContainer} />
                <Route
                    path="/hour-with-company"
                    component={HourWithCompanyContainer}/>
            </Switch>
        </BrowserRouter>
    </div>
);

const BunchMarketingContainer = () => (
    <div>
        <NavBarBunchMarketing
            isTranslationOn={false}
        />
        <Switch>
            <Route
                path="/bunch-marketing"
                render={(props) =>
                    <BlockBunchMarketing
                        {...props}
                        isTranslationOn={false}
                        videoId={"c31lbf-l9l8"}
                    />
                }
            />
        </Switch>
        <Footer/>
    </div>
);

const BunchCommunicationContainer = () => (
    <div>
        <NavBarBunchCommunication
            isTranslationOn={false}
        />
        <Switch>
            <Route
                path="/bunch-communication"
                render={(props) =>
                    <BlockBunchCommunication
                        {...props}
                        isTranslationOn={false}
                        videoId={"c31lbf-l9l8"}
                    />
                }
            />
        </Switch>
        <Footer/>
    </div>
);

const BunchBusinessFinanceContainer = () => (
    <div>
        <NavBarBunchBusinessFinance
            isTranslationOn={false}
        />
        <Switch>
            <Route
                path="/bunch-business-finance"
                render={(props) =>
                    <BlockBunchBusinessFinance
                        {...props}
                        isTranslationOn={false}
                        videoId={"c31lbf-l9l8"}
                    />
                }
            />
        </Switch>
        <Footer/>
    </div>
);

const HourWithCompanyContainer = () => (
    <div>
        <NavBarHourWithCompany
            isTranslationOn={false}
        />
        <Switch>
            <Route
                path="/hour-with-company"
                render={(props) =>
                    <BlockHourWithCompany
                        {...props}
                        isTranslationOn={false}
                        videoId={"W7ipkmhsVPM"}
                    />
                }
            />
        </Switch>
        <Footer/>
    </div>
);

const ActivitiesContainer = () => (
    <div>
        <NavBarActivities/>
        <Switch>
            <Route path="/cases" component={BlockCases} />
            <Route path="/gifts" component={BlockGifts} />
            <Route path="/tests" component={BlockTests} />
            <Route path="/mini-tests" component={BlockMiniTests} />
        </Switch>
    </div>
);

const DefaultContainer = () => (
    <div>
        {/*<NavBarDuringEvent />*/}
        {/*<NavBarRegistration />*/}
        <NavBarEndEvent/>
        <Switch>
            <Route exact path="/" component={LandingBCF} />
        </Switch>
    </div>
);


export default Main;
